import logo from './logo.svg';
import './App.css';
import { Route } from 'react-router-dom';
import homepage from './components.js/homepage/home';

function App() {
  return (
    <div className="App">
      <Route path='/home'>
        <homepage/>
      </Route>
    </div>
  );
}

export default App;
